import React from 'react'
import logo from './banner.jpg';
import Jumbotron from 'react-bootstrap/jumbotron';
import Button from 'react-bootstrap/Button';
import Row from 'react-bootstrap/Row';
import Card from 'react-bootstrap/Card';
class Main extends React.Component {
  render() {
    return (
      <div>
      <img className="img-responsive" src={logo} alt="logo"/>
      <Jumbotron style = {{ width: '100rem', margin:  'auto', float: 'none', }}>
  <h1 style = {{ width: '80rem', margin: '0 auto', float: 'none', }}>Welcome to Reality Ministries Rideshare!</h1>
  <p style = {{ width: '80rem', margin: '0 auto', float: 'none', }}>
    This web application was created to allow volunteers the ability to rideshare! Please select an option from the dropdown menu to proceed.
  </p>

  </Jumbotron>
  <Card style={{ width: '18rem' }}>
  <Card.Img variant="top" src="holder.js/100px180" />
  <Card.Body>
    <Card.Title>Card Title</Card.Title>
    <Card.Text>
      Some quick example text to build on the card title and make up the bulk of
      the card's content.
    </Card.Text>
    <Button variant="primary">Go somewhere</Button>
  </Card.Body>
</Card>
      </div>
    )
  }
}
export default Main
